import React from 'react';
import { Formik, Form } from 'formik';
import TextField  from './TextField';

const Register = () => {
    const validate = Yup.object({
        firstName : Yup.string()
        .max(15,'Must be 15 characters')
    })
    return (
        <div><TextField /></div>
    );
};
export default Register;
